import styled from "styled-components";

const PageWrapper = styled.section`
  display: flex;
  height: 70vh;
  margin: 0;
  padding: 0;
  border: 1px solid red;
`;

const Image = styled.img`
  margin: 0;
  border: 1px solid black;
  border-radius: 50%;
  padding-top: 10%
  height: auto;
  width: 100%;
`;

export { PageWrapper, Image };
